    let addPost=()=>{
        props.dispatch(addPostActionCreaotor());
    }  
    let onPostChange=(text)=>{
       let action=updateNewPostTextActionCreator(text)
       props.dispatch(action)
    }
    return(
        <NewsOld updateNewPostTextActionCreator={onPostChange} addPost={addPost} posts={props.posts} newPost  ></NewsOld>
    )
}

